import React, { Component } from 'react';
import axios from 'axios'


import { MDBCol, MDBFormInline, MDBBtn, MDBIcon} from "mdbreact";


var config = {
    method: 'get',
    url: 'https://collections.thulb.uni-jena.de/api/v1/search?q=+cbuUnitTypes.actual:(33.0%20%20%20%20%20%20%20%20%20%2033.1)&wt=json',
    headers: { 
      'Authorization': 'Basic cmVzdGFwaS1yZWFkOmRlMjgxMjMyOGIzYTZmODc1NDIyYjM4NzZlMDJiZTM3'
    }
  };

class Search extends Component {

  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
  }


  componentDidMount() {
    axios(config).then(function (response){
        console.log(response);

        const data = response.data.response.docs[0]; //read results from api
        console.log(data);
        console.log(Object.keys(data))
        this.setState({data})
      })
      .catch(function (error){
        console.log(error);
      })
  }

